// react
import React, { Component } from 'react';

// third-party
import PropTypes from 'prop-types';
import { Link, Redirect, Route, Switch } from 'react-router-dom';

// application
import QuickSearch from './QuickSearch';
import SearchMenu from './SearchMenu';
import Breadcrumb from '../../shared/Breadcrumb';

// pages
import { SearchCriterias } from './search-criterias/index';
import { SearchCustom } from './search-custom/index';


export class Search extends Component {
    render() {
        return (
            <div className="ekat-search">
                <div className="ekat-search_quick-search">
                    <QuickSearch />
                </div>
                <div className="ekat-search_search-menu">
                    <SearchMenu />
                </div>

                <div>
                    <Route exact path="/search" component={SearchCriterias} />
                </div>
            </div>
        );
    }
}
